CORT,&nbsp; SFX-ABOP, AKUSTİK GİTAR
Ash Burl has been known to be one of the most complex and beautiful patterns on a tone wood. The modern SFX series with Ash Burl body has been highly sought after by players looking for that signature decorative patterns on an acoustic guitar. The new open pore finish lets out the true beauty of the patterns that players can touch and feel, while making the guitar sound more natural.
&nbsp;
Features
&nbsp;All Ash Burl Model:&nbsp;An exotic wood, ash burl is used on top, back and sides for a one-of-a-kind look, sound and feel. The woods sonic character is brilliant and sparkling with a solid punchy midrange and a tight low-end.Slim Body Depth:&nbsp;A modern concept developed for players seeking comfort and easier playability, the body depth is 83*83mm.CE304T EQ:&nbsp;Includes a 3-band EQ for tonal flexibility and a built-in LED tuner for convenience. This high-value EQ system delivers a rich midrange with clear transparent highs.&nbsp;
